import { useState } from "react";
import Button from "react-bootstrap/Button";
import Col from "react-bootstrap/Col";
import Form from "react-bootstrap/Form";
import Row from "react-bootstrap/Row";
import './RegisterPage.css';

export function RegisterPage() {
  const [customer, setCustomer] = useState({});
  const [authentication, setAuthentication] = useState({});

  const handleChange = (event) => {
    const name = event.target.name;
    const value = event.target.value;
    console.log(name);
    console.log(value);
    setCustomer((values) => ({ ...values, [name]: value }));
  };

  const handleSubmit = (event) => {
    const registrationData = {
      uname: customer.uname,
      pass: customer.pass,
      customer: {
        cust_Name: customer.cust_Name,
        phone_No: +customer.phone_No,
        email: customer.email,
        gender: customer.gender,
        redeem_points: 0,
        addLine1: customer.addLine1,
        addLine2: customer.addLine2,
        city: customer.city,
        pincode: parseInt(customer.pincode),
      },
    };

    let demo = JSON.stringify(registrationData);
    console.log(demo);

    fetch("http://localhost:8080/api/addAuthentication", {
      method: "POST",
      headers: { "Content-type": "application/json" },
      body: demo,
    }).then((res) => {
      console.log("ok");
    });

    //console.log(registrationData);
    //console.log(JSON.stringify(registrationData));
    event.preventDefault();
  };

  return (
    <div className="form">
      <Form onSubmit={handleSubmit}>
        <Row className='mb-3'>
          {/* <Form.Group as={Col} md={7} controlId='formGridusername'> */}
            <Col><Form.Label>Your Name</Form.Label></Col>
            <Col>
            <Form.Control
              type='text'
              placeholder='Enter Name'
              name='cust_Name'
              onChange={handleChange}
            />
            </Col>
          {/* </Form.Group> */}
        </Row>

        <Row>
          {/* <Form.Group as={Col} md={7} controlId='formGridEmail'> */}
          <Col><Form.Label>Email</Form.Label></Col>
          <Col><Form.Control
              type='email'
              placeholder='eg. example@gmail.com'
              name='email'
              onChange={handleChange}
            /></Col>
          {/* </Form.Group> */}
        </Row>

        <Row>
          {/* <Form.Group as={Col} md={3} controlId='formGridusername'> */}
          <Col><Form.Label>Username</Form.Label></Col>
          <Col><Form.Control
              type='text'
              placeholder='User Name'
              name='uname'
              onChange={handleChange}
            /></Col>
          {/* </Form.Group> */}
        </Row>

        <Row>
          {/* <Form.Group as={Col} md={9} controlId='formGridPassword'> */}
          <Col><Form.Label>Password</Form.Label></Col>
          <Col><Form.Control
              type='password'
              placeholder='Password'
              name='pass'
              onChange={handleChange}
            /></Col>
          {/* </Form.Group> */}
        </Row>

        <Row>
          {/* <Form.Group as={Col} md={9} controlId='formGridphone'> */}
          <Col><Form.Label>Phone</Form.Label></Col>
          <Col><Form.Control
              type='number'
              placeholder='eg. 9977336622'
              name='phone_No'
              onChange={handleChange}
            /></Col>
          {/* </Form.Group> */}
        </Row>

        <Row>
          {/* <Form.Group as={Col} md={9} controlId='formGridGender'> */}
          <Col><Form.Label>Gender</Form.Label></Col>
          <Col><Form.Select
              defaultValue='Choose...'
              name='gender'
              onChange={handleChange}
            >
              <option>Choose...</option>
              <option value={"M"}>Male</option>
              <option value={"F"}>Female</option>
            </Form.Select></Col>
          {/* </Form.Group> */}
        </Row>
        
        <Row>
          <Form.Group className='mb-3' controlId='formGridAddress1'>
            <Form.Label>Address</Form.Label>
            <Form.Control
              placeholder='1234 Main St'
              name='addLine1'
              onChange={handleChange}
            />
          </Form.Group>
        </Row>
        <Row>
          <Form.Group className='mb-3' controlId='formGridAddress2'>
            <Form.Label>Address 2</Form.Label>
            <Form.Control
              placeholder='Apartment, studio, or floor'
              name='addLine2'
              onChange={handleChange}
            />
          </Form.Group>
        </Row>
        <Row className='mb-3'>
          <Form.Group as={Col} controlId='formGridCity'>
            <Form.Label>City</Form.Label>
            <Form.Control placeholder='' name='city' onChange={handleChange} />
          </Form.Group>
        </Row>
        <Row>
          <Form.Group as={Col} controlId='formGridZip'>
            <Form.Label>Pincode</Form.Label>
            <Form.Control name='pincode' onChange={handleChange} />
          </Form.Group>
        </Row>
        <br/>
        <Button variant='primary' type='submit'>
          Submit
        </Button>
      </Form>
    </div>
  );
}
